import React from "react";

var style = {
  backgroundColor: "#F8F8F8",
  borderTop: "1px solid #E7E7E7",
  textAlign: "center",
  padding: "20px",
  position: "fixed",
  left: "0",
  bottom: "0",
  height: "60px",
  width: "100%",
};

var phantom = {
  display: "block",
  padding: "20px",
  height: "60px",
  width: "100%",
};

class Footer extends React.Component {
  constructor() {
    super();
    this.state = { cshow: "None Component Showing" };
  }

  render() {
    return <div>This is my test Footer page</div>;
  }
}

export default Footer;
